(3, 'COVID-19 live updates: Total number of cases passes 11 million', '     Previously, the World Health Organization (WHO) has stated that SARS-CoV-2 spreads primarily through small droplets that an infected person expels in coughs or sneezes. These droplets sink to the ground relatively quickly. However, the WHO is now considering evidence that floating virus particles might also be involved in transmission.\r\n\r\nInvited commentary in the journal Clinical Infectious Diseases outlines evidence that suggests this type of airborne spread. A total of 239 scientists reviewed the paper before publication.\r\n\r\nBecause airborne particles can linger in the air for longer, the scientists urge the WHO to update their guidance, such as the 1-meter physical distance rule. Jose Jimenez, one of the scientists who reviewed the paper, explains:\r\n\r\nâ€œWe wanted them to acknowledge the evidence. This is definitely not an attack on the WHO. Itâ€™s a scientific debate, but we felt we needed to go public because they were refusing to hear the evidence after many conversations with them.â€', '0000-00-00', );
