s in maintaining the good health of small intestine and digestion. The ispaghol fibers undergo slow fermentation in intestines, so they do no cause bloating and gas in your system.\r\n\r\nHelps in reducing weight\r\nBy improving the digestion, it helps in removing toxins from the body. Similarly, it also controls your food cravings and hence, controls your weight. If you take ispaghol husk with lemon and water mixture on empty stomach in the morning, it results in reducing your body weight\r\n\r\nRelief from acidity\r\nIt helps in digestion, so it also gives relief from acidity. It makes a protective layer in the stomach that helps in controlling stomach acidity. You can take ispaghol with cold water for better results.\r\n\r\nThese are some of the health benefits of ispaghol. The excess of anything is not good. So you should take ispaghol in a controlled amount. You can consult your dietitian for better guidance according to your medical history and physical health. You can consult the best dietitians in Lahore through Marham.\r\n\r\nDuring this COVID-19 pandemic, you can consult your health professionals by contacting them online. Marham is providing a platform where you can consult with doctors of all specialties. So you do not need to step out from your safe home, rather book your online consultation appointment with your health providers through Marham.\r\n\r\n ', '0000-00-00', );

